import styled from "styled-components";

export const OrderDetailContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;

  svg {
    width: 20px;
    height: 20px;
  }
`;

export const DetailHeadline = styled.span`
    font-weight: bold;
    padding-bottom: 20px;
    letter-spacing: 1px;
`;
